import { useEffect, useState } from "react";
import axios from "axios";
import "./App.css";

function App() {
  const [tracks, setTracks] = useState([]);
  useEffect(() => {
    const fetchAllTracks = async () => {
      try {
        const res = await axios.get("http://localhost:8080/tracks");
        console.log(res);
        setTracks(res.data);
      } catch (err) {
        console.log(err);
      }
    };
    fetchAllTracks();
  }, []);
  return (
    <div className="App">
      {tracks.map((track) => (
        <div>
          <div>{track.name}</div>
        </div>
      ))}
    </div>
  );
}

export default App;
